--
-- Name: activate_setup_cell_parameters(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION activate_setup_cell_parameters() RETURNS text
    AS $$

DECLARE

	id_menu_setup int4;
	id_menu_cell int4;
	menu_position int8;

	profiles RECORD;

BEGIN

	-- Identifiant du menu SETUP

	SELECT id_menu INTO id_menu_setup
	FROM menu_deroulant_intranet WHERE libelle_menu='SETUP';

	-- Identifiant et position du sous-menu "Setup Cell Parameters" dans le menu SETUP

	SELECT id_menu, CASE WHEN MAX(position)>0 THEN MAX(position)+1 ELSE 1 END INTO id_menu_cell, menu_position
	FROM menu_deroulant_intranet WHERE libelle_menu = 'Setup Cell parameters' GROUP BY id_menu;

	-- MAJ des tables profile_menu_position et profile	

	FOR profiles IN SELECT id_profile FROM profile WHERE profile_type = 'admin' AND profile_to_menu NOT LIKE '%'||id_menu_cell||'%' LOOP

		-- MAJ de la table profile_menu_position
		INSERT INTO profile_menu_position(id_menu, id_profile, position, id_menu_parent) VALUES (id_menu_cell, profiles.id_profile, menu_position, id_menu_setup);

		-- MAJ de la table profile
		UPDATE profile SET profile_to_menu = profile_to_menu||'-'||id_menu_cell WHERE profile_type = 'admin' AND id_profile = profiles.id_profile;

	END LOOP;

	-- MAJ de la table menu_deroulant_intranet

	UPDATE menu_deroulant_intranet SET is_profile_ref_admin = 1 WHERE id_menu = id_menu_cell;

    RETURN '';

END;

$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.activate_setup_cell_parameters() OWNER TO postgres;

--
-- Name: addauth(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION addauth(text) RETURNS boolean
    AS $_$
DECLARE
	lockid alias for $1;
	okay boolean;
	myrec record;
BEGIN
	-- check to see if table exists
	--  if not, CREATE TEMP TABLE mylock (transid xid, lockcode text)
	okay := 'f';
	FOR myrec IN SELECT * FROM pg_class WHERE relname = 'temp_lock_have_table' LOOP
		okay := 't';
	END LOOP; 
	IF (okay <> 't') THEN 
		CREATE TEMP TABLE temp_lock_have_table (transid xid, lockcode text);
			-- this will only work from pgsql7.4 up
			-- ON COMMIT DELETE ROWS;
	END IF;

	--  INSERT INTO mylock VALUES ( $1)
--	EXECUTE 'INSERT INTO temp_lock_have_table VALUES ( '||
--		quote_literal(getTransactionID()) || ',' ||
--		quote_literal(lockid) ||')';

	INSERT INTO temp_lock_have_table VALUES (getTransactionID(), lockid);

	RETURN true::boolean;
END;
$_$
    LANGUAGE plpgsql;


ALTER FUNCTION public.addauth(text) OWNER TO postgres;

