--
-- Name: capacity_planning_calculatedrech(integer, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_calculatedrech(nb_tch integer, hrp real) RETURNS real
    AS $$

DECLARE
	nb_drech real;
BEGIN

	-- calcul du DRECH
	nb_drech := nb_tch*2/(2-hrp);

	RETURN nb_drech;

END;

$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_calculatedrech(nb_tch integer, hrp real) OWNER TO postgres;

--
-- Name: capacity_planning_calculategos(real, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_calculategos(nb_tch real, trafficcarried real) RETURNS real
    AS $$

DECLARE

	gos decimal;
	k decimal := 1;
	delta decimal := 0.001;
	Ox decimal;
	Cx decimal;
	step decimal;
	threshold_zero decimal := 1e-10;
	decimal_trafficcarried decimal;

BEGIN

	Ox := trafficcarried;
	decimal_trafficcarried := trafficcarried;

	-- Si le trafic est plus grand que le nombre de channel
	-- ou si les valeurs en entrée sont incohérentes, alors
	-- le calcul est stoppé et la fonction retourne null
	IF Ox >= nb_tch or nb_tch < 0 or Ox <= 0 or nb_tch is null or trafficcarried is null THEN
		RETURN null;
	-- sinon le gos est calculé
	ELSE
		IF nb_tch < 7 THEN
			step := 0.1;
		ELSIF nb_tch < 30 THEN
			step := 1;
		ELSIF nb_tch < 100 THEN
			step := 5;
		ELSIF nb_tch < 500 THEN
			step := 10;
		ELSE
			step := 50;
		END IF;

		LOOP
			step := step / 10;
			LOOP
				Ox := Ox + k * step;
				gos := 1;
				FOR i in 1..ROUND(nb_tch) LOOP
					gos := Ox * gos / (i + Ox * gos);
				END LOOP;
				Cx := Ox * (1 - gos);
				EXIT WHEN k * Cx >= k * decimal_trafficcarried;
			END LOOP;
			k := -k;
			EXIT WHEN Abs(Cx - decimal_trafficcarried) / Abs(decimal_trafficcarried) <= delta;
		END LOOP;
	END IF;

	-- si le gos calculé est inférieur à threshold_zero, le fonction retourne 0.
	IF gos < threshold_zero THEN
		gos := 0;
	END IF;

	RETURN CAST(gos AS real);

END;

$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_calculategos(nb_tch real, trafficcarried real) OWNER TO postgres;

--
-- Name: capacity_planning_calculatetchfromdrech(real, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_calculatetchfromdrech(nb_drech real, hrp real) RETURNS real
    AS $$

DECLARE
	nb_tch real;
BEGIN

	-- calcul du DRECH
	nb_tch := nb_drech*(2-hrp)/2;

	RETURN nb_tch;

END;

$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_calculatetchfromdrech(nb_drech real, hrp real) OWNER TO postgres;

