--
-- Name: capacity_planning_capacity_erlangb_cell(cell_configuration, real, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_capacity_erlangb_cell(cell_conf cell_configuration, gos real, hrp real) RETURNS real
    AS $$
DECLARE
	nb_tch real;
	capacity real;
BEGIN
	-- Calcul du nombre de TCH disponibles.
	nb_tch := cell_conf.nb_tch;
	IF cell_conf.hr_or_fr = 1 THEN
		-- La cellule est en mode half rate, la capacité doit être calculée avec le DRECH
		nb_tch := capacity_planning_calculatedrech(CAST(nb_tch AS integer), hrp);
	END IF;

	-- Calcul de la capacité
	capacity := capacity_planning_capacity_erlangb_tch(nb_tch, gos);
	RETURN capacity;
END;
$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_capacity_erlangb_cell(cell_conf cell_configuration, gos real, hrp real) OWNER TO postgres;

--
-- Name: capacity_planning_capacity_erlangb_tch(real, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_capacity_erlangb_tch(nb_tch real, gos real) RETURNS real
    AS $$

DECLARE

	nb_channel real;
	step real :=0;
	capacity real;
	delta real := 0.0001;
	k integer := 1;
	Eb real := 1;

BEGIN

	-- Le nombre de channel est arrondi à l'entier le plus proche.
	nb_channel := round(nb_tch);

	-- Si les valeurs en entrée sont incohérentes, la fonction retourne null.
	IF nb_channel <= 0 or gos >= 1 or gos <= 0 or nb_tch is null or gos is null THEN
		capacity := null;
	ELSE
		capacity := nb_channel;
		
		SELECT CASE INTO step
			WHEN capacity BETWEEN 1 AND 7 THEN 0.5
			WHEN capacity BETWEEN 8 AND 50 THEN 10
			WHEN capacity BETWEEN 51 AND 100 THEN 50
			WHEN capacity BETWEEN 101 AND 200 THEN 100
			WHEN capacity BETWEEN 201 AND 500 THEN 200
			WHEN capacity BETWEEN 501 AND 999 THEN 500
			ELSE 1000
		END;

		LOOP
			step := step / 10;
			
			LOOP

				capacity := capacity - k * step;
				Eb := 1;
				For i in 1..nb_channel LOOP
					Eb := capacity * Eb / (i + capacity * Eb);
				END LOOP;

				EXIT WHEN k * Eb <= k * GOS;
			END LOOP;
			
			k := -k;
			
			EXIT WHEN abs(Eb - gos) / Abs(gos) <= delta;
		END LOOP;

	END IF;

	RETURN capacity;

END;

$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_capacity_erlangb_tch(nb_tch real, gos real) OWNER TO postgres;

--
-- Name: capacity_planning_gettchnumberfortrx(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_gettchnumberfortrx(nb_trx integer) RETURNS integer
    AS $$
	
DECLARE
	nb_tch integer := 0;

BEGIN

	SELECT CASE nb_trx INTO nb_tch
		WHEN 1 THEN 6
		WHEN 2 THEN 12
		WHEN 3 THEN 19
		WHEN 4 THEN 26
		WHEN 5 THEN 32
		WHEN 6 THEN 39
		WHEN 7 THEN 46
		WHEN 8 THEN 53
		WHEN 9 THEN 60
		WHEN 10 THEN 67
		WHEN 11 THEN 74
		WHEN 12 THEN 81
		WHEN 13 THEN 88
		WHEN 14 THEN 95
		WHEN 15 THEN 102
		WHEN 16 THEN 109
		WHEN 17 THEN 116
		WHEN 18 THEN 123
		WHEN 19 THEN 130
		WHEN 20 THEN 137
		WHEN 21 THEN 144
		WHEN 22 THEN 151
		WHEN 23 THEN 158
		WHEN 24 THEN 165
		ELSE null
	END;

	RETURN nb_tch;

END;

$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_gettchnumberfortrx(nb_trx integer) OWNER TO postgres;

--
-- Name: capacity_planning_gettrxnumberfortch(real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_gettrxnumberfortch(nb_tch real) RETURNS integer
    AS $$
	
DECLARE
	nb_trx integer := 0;

BEGIN

	SELECT CASE INTO nb_trx
		WHEN nb_tch <= 6 THEN 1
		WHEN nb_tch BETWEEN 6 AND 12 THEN 2
		WHEN nb_tch BETWEEN 12 AND 19 THEN 3
		WHEN nb_tch BETWEEN 19 AND 26 THEN 4
		WHEN nb_tch BETWEEN 26 AND 32 THEN 5
		WHEN nb_tch BETWEEN 32 AND 39 THEN 6
		WHEN nb_tch BETWEEN 39 AND 46 THEN 7
		WHEN nb_tch BETWEEN 46 AND 53 THEN 8
		WHEN nb_tch BETWEEN 53 AND 60 THEN 9
		WHEN nb_tch BETWEEN 60 AND 67 THEN 10
		WHEN nb_tch BETWEEN 67 AND 74 THEN 11
		WHEN nb_tch BETWEEN 74 AND 81 THEN 12
		WHEN nb_tch BETWEEN 74 AND 81 THEN 13
		WHEN nb_tch BETWEEN 81 AND 95 THEN 14
		WHEN nb_tch BETWEEN 95 AND 102 THEN 15
		WHEN nb_tch BETWEEN 102 AND 109 THEN 16
		WHEN nb_tch BETWEEN 109 AND 116 THEN 17
		WHEN nb_tch BETWEEN 116 AND 123 THEN 18
		WHEN nb_tch BETWEEN 123 AND 130 THEN 19
		WHEN nb_tch BETWEEN 130 AND 137 THEN 20
		WHEN nb_tch BETWEEN 137 AND 144 THEN 21
		WHEN nb_tch BETWEEN 144 AND 151 THEN 22
		WHEN nb_tch BETWEEN 151 AND 158 THEN 23
		WHEN nb_tch BETWEEN 158 AND 165 THEN 24
		WHEN nb_tch > 165 THEN null
	END;

	RETURN nb_trx;

END;

$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_gettrxnumberfortch(nb_tch real) OWNER TO postgres;

