CREATE FUNCTION capacity_planning_gosatbh(cell_id text, traffic_carried real, hrp real) RETURNS real
    AS $$
DECLARE
	cell_conf cell_configuration;
BEGIN
	-- Récupération de la configuration de la cellule
	cell_conf := capacity_planning_load_cell_configuration(cell_id);

	-- Calcul de la capacité
	RETURN capacity_planning_gosatbh(cell_conf, traffic_carried, hrp);
END;
$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_gosatbh(cell_id text, traffic_carried real, hrp real) OWNER TO postgres;

--
-- Name: capacity_planning_gosatbh(cell_configuration, real, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_gosatbh(cell_conf cell_configuration, traffic_carried real, hrp real) RETURNS real
    AS $$
DECLARE
	nb_tch real;
	gos real;
BEGIN
	-- Calcul du nombre de TCH disponibles.
	nb_tch := cell_conf.nb_tch;
	IF cell_conf.hr_or_fr = 1 THEN
		-- La cellule est en mode half rate, la capacité doit être calculée avec le DRECH
		-- cell_conf.nb_tch est un integer, on peut le caster.
		nb_tch := capacity_planning_calculatedrech(CAST(nb_tch AS integer), hrp);
	END IF;

	-- Calcul de la capacité
	gos := capacity_planning_calculategos(nb_tch, traffic_carried);
	RETURN gos;
END;
$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_gosatbh(cell_conf cell_configuration, traffic_carried real, hrp real) OWNER TO postgres;

--
-- Name: capacity_planning_load_cell_configuration(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_load_cell_configuration(cell_id text) RETURNS cell_configuration
    AS $$
DECLARE
	cell_conf cell_configuration;
BEGIN
	SELECT t_ref.cell, t_ref.nb_tch, CASE WHEN t_ref.nb_real_tch IS NOT NULL THEN t_ref.nb_real_tch ELSE capacity_planning_gettchnumberfortrx(nb_tch) END, t_ref.hr_or_fr, t_ref.hru / 100 INTO cell_conf
	FROM edw_object_capacity_ref t_ref
	WHERE cell = cell_id;

	RETURN cell_conf;
END
$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_load_cell_configuration(cell_id text) OWNER TO postgres;

--
-- Name: capacity_planning_offeredtraffic(text, real, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_offeredtraffic(cell_id text, traffic_carried real, hrp real) RETURNS real
    AS $$
DECLARE
	cell_conf cell_configuration;
BEGIN
	-- Récupération de la configuration de la cellule
	cell_conf := capacity_planning_load_cell_configuration(cell_id);
	-- Calcul du trafic offert.
	RETURN capacity_planning_offeredtraffic(cell_conf, traffic_carried, hrp);
END;
$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_offeredtraffic(cell_id text, traffic_carried real, hrp real) OWNER TO postgres;

--
-- Name: capacity_planning_offeredtraffic(cell_configuration, real, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_offeredtraffic(cell_conf cell_configuration, traffic_carried real, hrp real) RETURNS real
    AS $$
DECLARE
	offered_traffic real;
	gos real;
BEGIN
	-- Calcul du GOS at BH pour la cellule et le trafic donnés.
	gos := capacity_planning_gosatbh(cell_conf, traffic_carried, hrp);

	-- Calcul du trafic offert.
	offered_traffic := traffic_carried / (1 - gos);
	RETURN offered_traffic;
END;
$$
    LANGUAGE plpgsql;


