--
-- Name: capacity_planning_requiredtch(real, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_requiredtch(gos real, traffic real) RETURNS integer
    AS $$

DECLARE

	nb_channel integer := 1;
	Eb real := 1;

BEGIN

	-- Si un des paramètres d'entrée est null, la fonction retourne null.
	IF gos IS null or traffic IS null or gos <= 0 THEN
		RETURN null;
	END IF;

	LOOP
		nb_channel := nb_channel + 1;
		Eb := 1;
		FOR i in 1..nb_channel LOOP
			Eb := traffic * Eb / (i + traffic * Eb);
		END LOOP;
		EXIT WHEN Eb <= gos;
	END LOOP;

	RETURN nb_channel;

END;

$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_requiredtch(gos real, traffic real) OWNER TO postgres;

--
-- Name: capacity_planning_trafficlowerthreshold(text, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_trafficlowerthreshold(cell_id text, gos real) RETURNS real
    AS $$

DECLARE
	traffic real;
	cell_conf cell_configuration;
BEGIN

	-- Récupération de la configuration de la cellule
	cell_conf := capacity_planning_load_cell_configuration(cell_id);

	IF cell_conf.nb_trx = 1 or cell_conf.nb_trx = 2 THEN
		traffic := capacity_planning_capacity_erlangb_tch(cell_conf.nb_tch, gos);
	ELSE
		traffic := capacity_planning_capacity_erlangb_tch(capacity_planning_gettchnumberfortrx(cell_conf.nb_trx-1), gos);
	END IF;

	RETURN traffic;

END;

$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_trafficlowerthreshold(cell_id text, gos real) OWNER TO postgres;

--
-- Name: capacity_planning_trafficupperthreshold(text, real, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_trafficupperthreshold(cell_id text, gos real, hrp real) RETURNS real
    AS $$
DECLARE
	cell_conf cell_configuration;
	traffic real;
	nb_drech real;
BEGIN
	-- Récupération de la configuration de la cellule
	cell_conf := capacity_planning_load_cell_configuration(cell_id);

	-- Calcul du nombre de DRECH (dual rate ewuivalent channel).
	nb_drech := capacity_planning_calculatedrech(cell_conf.nb_tch, hrp);

	-- Calcul du trafic upper threshold: capacité * hru.
	traffic := capacity_planning_capacity_erlangb_tch(nb_drech, gos) * cell_conf.hru;
	RETURN traffic;
END;
$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_trafficupperthreshold(cell_id text, gos real, hrp real) OWNER TO postgres;

--
-- Name: capacity_planning_ts_needed(cell_configuration, real, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_ts_needed(cell_conf cell_configuration, traffic real, hrp real) RETURNS integer
    AS $$
DECLARE
	nb_tch_needed real;
BEGIN
	IF (cell_conf).nb_trx IS NULL OR (cell_conf).hr_or_fr IS NULL THEN
		RETURN NULL;
	END IF;

	-- Calcul du nombre de tch nécessaire.
	nb_tch_needed := capacity_planning_requiredtch(0.02, traffic);
	IF (cell_conf).hr_or_fr = 1 THEN
		nb_tch_needed := capacity_planning_calculatetchfromdrech(nb_tch_needed, hrp);
	END IF;

	-- La fonction retourne le nombre de TRX nécessaire moins le nombre de TRX installé.
	RETURN capacity_planning_gettrxnumberfortch(nb_tch_needed) - (cell_conf).nb_trx;
END;
$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.capacity_planning_ts_needed(cell_conf cell_configuration, traffic real, hrp real) OWNER TO postgres;

