-- Name: capacity_planning_ts_utilisation(cell_configuration, real, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION capacity_planning_ts_utilisation(cell_conf cell_configuration, traffic real, hrp real) RETURNS real
    AS $$
