--
-- Name: channels(numeric, numeric); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION channels(a numeric, p numeric) RETURNS integer
    AS $$
DECLARE
	n int;
	cp numeric;
	startLoop smallint;
	inc numeric;
BEGIN
	n = ceil(a/2);	
	startLoop = 0;
	IF a > 10 THEN
		startLoop = floor(log(a)) * (-1);
	END IF;
	
	FOR nbz IN startLoop..0 BY 1
	LOOP
		inc = 1/power(10,(nbz));
		cp = GOS(a,n);	
		WHILE cp > p
		LOOP					
			n = n + inc;
			cp = GOS(a,n);
		END LOOP;
		n = n - inc;
	END LOOP;

	RETURN round(n+inc);
END;
$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.channels(a numeric, p numeric) OWNER TO postgres;

--
-- Name: checkauth(text, text, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION checkauth(text, text, text) RETURNS integer
    AS $_$
DECLARE

	schema text;

BEGIN
	IF NOT LongTransactionsEnabled() THEN
		RAISE EXCEPTION 'Long transaction support disabled, use EnableLongTransaction() to enable.';
	END IF;


	if ( $1 != '' ) THEN
		schema = $1;
	ELSE
		SELECT current_schema() into schema;
	END IF;


	-- TODO: check for an already existing trigger ?

	EXECUTE 'CREATE TRIGGER check_auth BEFORE UPDATE OR DELETE ON ' 

		|| quote_ident(schema) || '.' || quote_ident($2)



		||' FOR EACH ROW EXECUTE PROCEDURE CheckAuthTrigger('
		|| quote_literal($3) || ')';

	RETURN 0;
END;
$_$
    LANGUAGE plpgsql;


