CREATE FUNCTION create_column_with_table_check(table_to_check text, my_column text, my_type text, my_default text) RETURNS void
    AS $$
BEGIN
	IF EXISTS (SELECT relname FROM pg_class WHERE relname='||table_to_check||') 
	THEN
		SELECT create_column_with_check('||table_to_check||','||my_column||','||my_type||','||my_default||');
	END IF;
END;
$$
    LANGUAGE plpgsql;


