--
-- Name: erlangb(text, text, text, real, real, numeric, numeric, numeric, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION erlangb(netval text, network text, na_encours_network text, counter_traffic real, counter_tch real, p numeric, n numeric, a numeric, "mode" text) RETURNS numeric
    AS $$
DECLARE
	cel RECORD;
	cmpt numeric;
	cmpt_tch numeric;
	result numeric;
	tch numeric;
	hrp numeric;
	tchinter INT;
	myrec RECORD;
BEGIN



	-- 16:35 15/01/2010 SCT : on intègre le test du NA à l'intérieur de la fonction
	IF network = na_encours_network THEN

		result:=0;
		hrp:=0.65;
		cmpt:=0;
		cmpt_tch:=0;
		tch:=0;
		
		-- Memorise les cellules
		SELECT * INTO cel
		FROM edw_object_ref_parameters, edw_object_ref
		WHERE eorp_id = eor_id
		AND eor_on_off = 1
		AND eor_obj_type = ''||network||''
		AND eor_id = ''||netval||'';

		-- Si pas de resultat, on sort 
		IF NOT FOUND THEN
			return result;
		END IF;
		IF n > 0 THEN
			tch := n;
		ELSE
			IF counter_tch IS NOT NULL 
			THEN
				-- 16:26 15/01/2010 SCT : on spécifie la variable tch en integer => les fonctions GOS et TRAFFIC attendent ce paramètre en integer
				tch := counter_tch::integer;
			ELSE
			
				SELECT CASE cel.eorp_trx INTO tch
					WHEN 1 THEN 6
					WHEN 2 THEN 12
					WHEN 3 THEN 19
					WHEN 4 THEN 26
					WHEN 5 THEN 32
					WHEN 6 THEN 39
					WHEN 7 THEN 46
					WHEN 8 THEN 53
					WHEN 9 THEN 60
					WHEN 10 THEN 67
					WHEN 11 THEN 74
					WHEN 12 THEN 81
					WHEN 13 THEN 88
					WHEN 14 THEN 95
					WHEN 15 THEN 102
					WHEN 16 THEN 109
					WHEN 17 THEN 116
					WHEN 18 THEN 123
					WHEN 19 THEN 130
					WHEN 20 THEN 137
					WHEN 21 THEN 144
					WHEN 22 THEN 151
					WHEN 23 THEN 158
					WHEN 24 THEN 165
					ELSE 0
				END;
				
				-- 11:30 22/12/2009 SCT : on spécifie la variable tch en integer
				IF cel.eorp_charge = 1 AND tch > 0 THEN
					tch := (tch*2/(2-hrp))::integer;
				END IF;
				
			END IF;
		END IF;
		
		-- 04/01/2010 BBX : la condition suivante ne doit etre appelée que si mode != traffic
		IF mode <> 'TRAFFIC' THEN
			IF a > 0 THEN
				cmpt := a;
			ELSE
				IF counter_traffic IS NOT NULL THEN		
					cmpt := counter_traffic;
				ELSE
					RETURN 0;
				END IF;
			END IF;
		END IF;

		IF mode = 'GOS' THEN
			tchinter := tch;
			result := GOS(cmpt,tchinter);
			-- 18/01/2010 MPR : On retourne 2 pour 2% et non 0.02
			result := result*100;
		END IF;
		IF mode = 'CHANNELS' THEN
			-- 06/01/2010 SCT : Limitation de la valeur de cmpt à 300 => au dessus de cette valeur (ou pour de grande valeur), le calcul de la fonction CHANNELS est trop long (vu avec PGR)
			IF cmpt >= 300 THEN
				result := 0;
			ELSE
				result := CHANNELS(cmpt,(p/100)::numeric);
			END IF;
		END IF;
		IF mode = 'TRAFFIC' THEN
			tchinter := tch;
			-- 06/01/2010 SCT : Limitation de la valeur de tchinter à 300 => au dessus de cette valeur (ou pour de grande valeur), le calcul de la fonction TRAFFIC est trop long (vu avec PGR)
			IF tchinter >= 300 THEN
				result := 0;
			ELSE
				result := TRAFFIC((p/100)::numeric,tchinter);
			END IF;
		END IF;
	ELSE
		result := null;
	END IF;
	RETURN result;
END;
$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.erlangb(netval text, network text, na_encours_network text, counter_traffic real, counter_tch real, p numeric, n numeric, a numeric, "mode" text) OWNER TO postgres;

--
-- Name: erlangb(text, text, text, double precision, anyelement, numeric, numeric, numeric, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION erlangb(netval text, network text, na_encours_network text, counter_traffic double precision, counter_tch anyelement, p numeric, n numeric, a numeric, "mode" text) RETURNS numeric
    AS $$
DECLARE
	cel RECORD;
	cmpt numeric;
	cmpt_tch numeric;
	result numeric;
	tch numeric;
	hrp numeric;
	tchinter INT;
	myrec RECORD;
BEGIN

	-- 16:35 15/01/2010 SCT : on intègre le test du NA à l'intérieur de la fonction
	IF network = na_encours_network THEN

		result:=0;
		hrp:=0.65;
		cmpt:=0;
		cmpt_tch:=0;
		tch:=0;

		-- 11/03/2010 NSE bz 14713 si on recherche le Gos ou le Traffic, on récupère le TCH passé en paramètre ou on le retrouve en la topo
		IF mode <> 'CHANNELS' THEN
		
			-- si on a passé une valeur numérique pour TCH, on l'utilise
			IF n > 0 THEN
				tch := n;
			ELSE
				-- 11/03/2010 NSE bz 14713 sinon, soit on doit retrouver le TCH à partir de la topo, soit à partir du compteur
				-- si on a false dans le compteur, c'est qu'il faut regarder en topo
				IF counter_tch = false
				THEN 
					-- Memorise les cellules
					SELECT * INTO cel
					FROM edw_object_ref_parameters, edw_object_ref
					WHERE eorp_id = eor_id
					AND eor_on_off = 1
					AND eor_obj_type = ''||network||''
					AND eor_id = ''||netval||'';
					
					-- Si pas de resultat, on sort 
					IF NOT FOUND THEN
						-- 11/03/2010 NSE on retroune null et non 0 si on n'a pas de résultat
						return null;
					END IF;
			
					SELECT CASE cel.eorp_trx INTO tch
						WHEN 1 THEN 6
						WHEN 2 THEN 12
						WHEN 3 THEN 19
						WHEN 4 THEN 26
						WHEN 5 THEN 32
						WHEN 6 THEN 39
						WHEN 7 THEN 46
						WHEN 8 THEN 53
						WHEN 9 THEN 60
						WHEN 10 THEN 67
						WHEN 11 THEN 74
						WHEN 12 THEN 81
						WHEN 13 THEN 88
						WHEN 14 THEN 95
						WHEN 15 THEN 102
						WHEN 16 THEN 109
						WHEN 17 THEN 116
						WHEN 18 THEN 123
						WHEN 19 THEN 130
						WHEN 20 THEN 137
						WHEN 21 THEN 144
						WHEN 22 THEN 151
						WHEN 23 THEN 158
						WHEN 24 THEN 165
						ELSE 0
					END;
					
					-- 11:30 22/12/2009 SCT : on spécifie la variable tch en integer
					IF cel.eorp_charge = 1 AND tch > 0 THEN
						tch := (tch*2/(2-hrp))::integer;
					END IF;
				
				ELSE
					-- 11/03/2010 NSE bz 14713 soit on a passé un compteur
					-- si le compteur n'est pas null, on retourne sa valeur
					IF counter_tch IS NOT NULL 
					THEN
						-- 16:26 15/01/2010 SCT : on spécifie la variable tch en integer => les fonctions GOS et TRAFFIC attendent ce paramètre en integer
						tch := counter_tch::integer;
					ELSE
						-- 11/03/2010 NSE bz 14713 sinon, on retour null
						return null;					
					END IF;
				END IF;
			END IF;
		END IF;
		
		-- 04/01/2010 BBX : la condition suivante ne doit etre appelée que si mode != traffic
		IF mode <> 'TRAFFIC' THEN
			IF a > 0 THEN
				cmpt := a;
			ELSE
				IF counter_traffic IS NOT NULL THEN		
					cmpt := counter_traffic;
				ELSE
					-- NSE bz 14713 retourne null et non 0 si le compteur vaut null
					RETURN null;
				END IF;
			END IF;
		END IF;

		IF mode = 'GOS' THEN
			tchinter := tch;
			result := GOS(cmpt::numeric,tchinter);
			-- 18/01/2010 MPR : On retourne 2 pour 2% et non 0.02
			result := result*100;
		END IF;
		
		IF mode = 'CHANNELS' THEN
			-- 06/01/2010 SCT : Limitation de la valeur de cmpt à 300 => au dessus de cette valeur (ou pour de grande valeur), le calcul de la fonction CHANNELS est trop long (vu avec PGR)
			IF cmpt >= 300 THEN
				result := 0;
			ELSE
				result := CHANNELS(cmpt::numeric,(p/100)::numeric);
			END IF;
		END IF;
		
		IF mode = 'TRAFFIC' THEN
			tchinter := tch;
			-- 06/01/2010 SCT : Limitation de la valeur de tchinter à 300 => au dessus de cette valeur (ou pour de grande valeur), le calcul de la fonction TRAFFIC est trop long (vu avec PGR)
			IF tchinter >= 300 THEN
				result := 0;
			ELSE
				result := TRAFFIC((p/100)::numeric,tchinter);
			END IF;
		END IF;
	ELSE
		result := null;
	END IF;
	RETURN result;
END;
$$
    LANGUAGE plpgsql;


