--
-- Name: getgrouptablefromna(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION getgrouptablefromna(na text) RETURNS text
    AS $$

DECLARE
	query text;
	group_table text;
	ref_table text;
BEGIN

	-- Selection du group table auquel appartient la na
	
	query = 'SELECT DISTINCT t_group.edw_group_table AS group_table, t_cat.object_ref_table AS ref_table
		 FROM sys_definition_network_agregation t_net, sys_definition_categorie t_cat, sys_definition_group_table t_group
		 WHERE t_net.agregation = '||quote_literal(na)||' 
		 AND t_net.family = t_cat.family
		 AND t_net.family = t_group.family
		 ORDER BY ref_table ASC
		 LIMIT 1';

	EXECUTE query INTO group_table, ref_table;

	RETURN group_table;
END;

$$
    LANGUAGE plpgsql;


