--
-- Name: gos(numeric, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION gos(a numeric, n integer) RETURNS numeric
    AS $$
DECLARE
	s numeric(12,6);
	v numeric;
	i int;
BEGIN
	IF a = 0 THEN RETURN 0.0000;
	END IF;

	s = 0.0000;
	
	FOR i IN 1..n
	LOOP
		s = (1.0000 + s)*(i/a);
	END LOOP;

	RETURN round ((1.0000/(1.0000 + s)), 4);

	EXCEPTION
		WHEN numeric_value_out_of_range
	THEN RETURN 0.0000;
		WHEN division_by_zero
	THEN RETURN 0.0000;

END;
$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.gos(a numeric, n integer) OWNER TO postgres;

