--

CREATE FUNCTION reporting_update_rep_cell_day() RETURNS void
    AS $$
DECLARE
	nb_table_rep_cell_day integer;
BEGIN
	-- Vérification de l'existence de la table rep_cell_day
	select count(*) INTO nb_table_rep_cell_day from pg_tables where tablename = 'rep_cell_day';
	
	IF nb_table_rep_cell_day > 0 THEN
		-- La table rep_cell_day existe, on peut donc réaliser sa mise à jour à partir des données de edw_object_capacity_ref.
		DELETE FROM rep_cell_day WHERE "day" = CAST(to_char(CURRENT_DATE, 'YYYYMMDD') AS integer);
		INSERT INTO rep_cell_day (cell, "day", nb_tch, nb_trx, hr_or_fr, hru)
		SELECT cell, CAST(to_char(CURRENT_DATE, 'YYYYMMDD') AS integer), CASE WHEN nb_real_tch is null THEN capacity_planning_gettchnumberfortrx(nb_tch) ELSE nb_real_tch END, nb_tch, hr_or_fr, hru
		FROM edw_object_capacity_ref;
	END IF;
END
$$
    LANGUAGE plpgsql;


