--
-- Name: ri_calculation(text, text, text, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION ri_calculation(text, text, text, text) RETURNS text
    AS $_$
DECLARE
	min_network ALIAS FOR $1;
	tablename ALIAS FOR $2;
	net ALIAS FOR $3;
	net_value ALIAS FOR $4;
	row RECORD;
	query text;
	condition_value text;
BEGIN
	IF net!=min_network THEN
	condition_value:= ''''||net_value||'''';
	IF condition_value!='' THEN 
	query := ' SELECT count(*) as number FROM ' || tablename || ' WHERE ' || net || '='||condition_value;
	RAISE NOTICE 'query(%)', query;
	FOR row IN EXECUTE query LOOP 
		RETURN row.number;
	END LOOP;
	ELSE RETURN NULL;
	END IF;

ELSE
	     RETURN 1;
	END IF;
	     
END;
$_$
    LANGUAGE plpgsql;


ALTER FUNCTION public.ri_calculation(text, text, text, text) OWNER TO postgres;

--
-- Name: ri_calculation(text, text, text, text, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION ri_calculation(text, text, text, text, text) RETURNS text
    AS $_$
DECLARE
	min_network ALIAS FOR $1;
	tablename ALIAS FOR $2;
	net ALIAS FOR $3;
	net_value ALIAS FOR $4;
	arc_value ALIAS FOR $5;

	row RECORD;
	query text;
	condition_value text;
	condition_arc text;
	total integer;

BEGIN

	IF net!=min_network THEN
		condition_value:= ''''||net_value||'''';
		condition_arc:= ''''||arc_value||'''';
		IF condition_value!='' THEN 
			query := ' SELECT count(*) as number FROM edw_object_arc_ref WHERE eoar_id_parent='||condition_value||' AND  eoar_arc_type='||condition_arc;
			RAISE NOTICE 'query(%)', query;
			FOR row IN EXECUTE query LOOP 
				RETURN row.number;
			END LOOP;
		
		ELSE RETURN NULL;
		END IF;

	ELSE
	     RETURN 1;
	END IF;
END;
$_$
    LANGUAGE plpgsql;


