--
-- Name: schedule_replace_id(text, integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION schedule_replace_id(text, integer, integer) RETURNS text
    AS $_$
DECLARE
	list TEXT;
	old_id INTEGER;
	new_id INTEGER;
	compteur INTEGER;
	result TEXT;
	id TEXT;
BEGIN
	list := $1;
	old_id := $2;
	new_id := $3;
	result := '';
	compteur := 0;

	LOOP
		compteur := compteur + 1;
		SELECT split_part(list, ',', compteur) INTO id;

		EXIT WHEN id = '';

		IF id = old_id::text THEN
			id := new_id::text;
		END IF;
		
		IF result = '' THEN
			result = id;
		ELSE
			result = result || ',' || id;
		END IF;
	END LOOP;
	
	RETURN result;
END;
