--
-- Name: traffic(numeric, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION traffic(p numeric, n integer) RETURNS numeric
    AS $$
DECLARE
	a numeric;
	val numeric;
	prec smallint;
	startLoop smallint;
	NBZ smallint;
	inc numeric;
	cp numeric;
BEGIN
	a := 0;
	val := 0;
	prec := 4;
	
	IF p >= 1 THEN
		RETURN round(n * p * 100,prec);
	END IF;
	
	IF n <= 0 THEN
		startLoop = 0;
	ELSE
		startLoop = floor(log(n)) * (-1);
	END IF;
	
	FOR NBZ IN startLoop..(prec+1) BY 1 
	LOOP
		inc := 1/power(10,(NBZ));
		a := val;
		cp := GOS(a,n,prec+3);
		
		WHILE cp <= p LOOP
			val := a;			
			a := a + inc;			
			cp := GOS(a,n,prec+3);
		END LOOP;

	END LOOP;

	RETURN round(a,prec);
END;
$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.traffic(p numeric, n integer) OWNER TO postgres;

