--
-- Name: ts_needed_function(text, double precision); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION ts_needed_function(cell_id text, traffic double precision) RETURNS integer
    AS $$

DECLARE
	nb_trx integer;
	hr_or_fr integer;
	needed integer;

BEGIN

	SELECT t_ref.nb_tch, t_ref.hr_or_fr INTO nb_trx, hr_or_fr
	FROM edw_object_capacity_ref t_ref
	WHERE cell = cell_id;

	SELECT CASE WHEN (nb_trx IS NOT NULL AND hr_or_fr IS NOT NULL) INTO needed
		THEN ReverseCapacityErlangB(traffic, hr_or_fr)-nb_trx
		ELSE NULL
	END;

	RETURN needed;

END;

$$
    LANGUAGE plpgsql;


ALTER FUNCTION public.ts_needed_function(cell_id text, traffic double precision) OWNER TO postgres;

