-- Name: ts_utilisation_function(text, double precision); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION ts_utilisation_function(cell_id text, traffic double precision) RETURNS double precision
    AS $$

DECLARE
	nb_trx integer;
	hr_or_fr integer;
	utilisation float8;

BEGIN

	SELECT t_ref.nb_tch, t_ref.hr_or_fr INTO nb_trx, hr_or_fr
	FROM edw_object_capacity_ref t_ref
	WHERE cell = cell_id;

	SELECT CASE WHEN (nb_trx IS NOT NULL AND hr_or_fr IS NOT NULL) INTO utilisation
		THEN traffic/CapacityErlangB(nb_trx, hr_or_fr) 
		ELSE NULL
	END;

	RETURN utilisation;

END;

$$
    LANGUAGE plpgsql;


